    },[]);*/

    return(
    <div className="body"> 
        <div className="container">
            <div className="mainContent">
                <div className="carouselRec">
                    <div className="carouselImage">
                    {/*{carouselData.length > 0 ? (
                    <Carousel images={carouselData} />
                ) : (
                    <p>Loading...</p>
                )}*/}
                    <Carousel/>
                    </div>
                </div>
                <div className="weekNewsRec">
                    <CircleCard>
                    <img width="25px" src={community} className="communityIcon" alt="community" />
                    <a className="communityText"  href="https://www.baidu.com">每周新番</a>
                    </CircleCard>
                </div>
            </div>
            <div className="sideContent">
                <div className="communityRec">
                    <CircleCard>
                    <img width="25px" src={community} className="communityIcon" alt="community" />
                    <a className="communityText"  href="https://www.baidu.com">社区讨论</a>
                    </CircleCard>
                </div>
            </div>
        </div>
    </div>
           
    );
}
